const First6March = (props) => {
    const students = [
        {name:"Person 1", age:23},
        {name:"Person 2", age:22},
        {name:"Person 3", age:21},
    ]
    return(
        <div>
            {students.map(std=><h1>My nam is {std.name} and I am ={std.age}</h1>)}
        </div>
    )
}

export default First6March;
